INSERT INTO `widget` (`id`, `authorid`, `projectid`, `title`, `type`, `data`, `comments`, `date`, `lastmodified`, `visibility`) VALUES
(1, 1, 1, 'Parts', 'textWidget', '1 x Arduino Uno, you will need 2 of these if you want to do 16 drives\n\nFemale to Female Jumper Wires\n\n1 x ATX Power Supply Unit\n\n1 x ATX Power supply tester plug, keeps the ATX Power Supply Turned on\n\nUSB Cables for the Arduinos\n\nPower Cable for the ATX Power Supply Unit, I would recommend 300w or more but it probably could be done with less as I doubt the floppy drives use much power.\n\n4 x 4 pin Molex to 2 Floppy drive plug adapters, you will need 6-8 of these if you want to run 16\n\n2 x 4 pin Molex splitters, this will turn one 4 pin Molex in to 2.\n\n8 x 3 1/4\" Floppy Disk Drives, or 16 drives, the max you can do with the Moppy software is 16.', '[]', '2019-05-19 13:41:27', '2019-05-19 13:41:27', 'PUBLIC'),
(2, 2, 2, 'Wikipedia', 'textWidget', '<p>A π (pí) egy matematikában és fizikában használt valós szám. A leggyakrabban használt, euklideszi geometriában a kör kerületének és átmérőjének hányadosaként definiálják, ami a körök hasonlósága miatt minden kör esetén azonos.</p>\n<p>A matematikai analízisben a körre való hivatkozás elkerülése érdekében szokás először a koszinuszt egy végtelen hatványsor összegeként definiálni, majd a π-t a koszinusz függvény legkisebb pozitív zérushelyének kétszereseként rögzíteni.</p>\n<p>A görög π betű a „περίμετρος” (perimetrosz, azaz kerület) szót rövidíti. Ezt a jelölést először William Jones használta 1707-ben, majd Leonhard Euler által 1737-ben lett igazán ismert. A π-t ritkábban Ludolph-féle számnak is nevezik, a német matematikus Ludolph van Ceulen tiszteletére, aki a π-nek minél több tizedesjegyét próbálta meghatározni.</p>\n\nhttps://hu.wikipedia.org/wiki/P%C3%AD_(sz%C3%A1m) ', '[]', '2019-05-19 13:47:43', '2019-05-19 13:47:43', 'PUBLIC');
