(5, 1, 1, 'Tools', 'textWidget', 'Insulation Tape\n\nWire Cutters\n\nWire Strippers\n\nPC With Windows', '[]', '2019-05-19 14:46:11', '2019-05-19 14:46:11', 'PUBLIC'),
(6, 1, 1, 'Software', 'textWidget', 'Arduino Software (here: https://www.arduino.cc/en/Main/Software )\n\nTimer1 Library for Arduino (here: https://code.google.com/archive/p/arduino-timerone/downloads )\n\nJDK 7u65 with NetBeans 8.0 (here: https://www.oracle.com/technetwork/java/javase/downloads/jdk-7-netbeans-download-432126.html )\n\nRXTXcomm Serial Driver (here: https://github.com/SammyIAm/Moppy2/tree/ec7e4375c375450aa0c96f1930b26d9125d66e0b/Java/SerialDrivers )\n\nMoppy Software (here: https://github.com/SammyIAm/Moppy2 )\n\nNOTE: some floppy drives are louder than others, so it might pay to try a couple out first before buying loads of them, Ideally you want loud drives but you want all of them to be loud. It will be no good if one drive is really loud and the others are quieter as the loud one will drown out the sound of the others.', '[]', '2019-05-19 14:46:35', '2019-05-19 14:46:35', 'PUBLIC'),
